import React from 'react'
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom'
import { Toaster } from 'react-hot-toast'
import { 
  Users,
  FileText,
  CheckCircle,
  AlertCircle,
  Clock,
  Search,
  BarChart3,
  Calendar
} from 'lucide-react';

// Layout
import DashboardLayout from './layouts/DashboardLayout'

// Pages
import Home from './pages/Home'
import Login from './pages/auth/Login'
import Register from './pages/auth/Register'

// Dashboards
import StudentDashboard from './pages/dashboard/StudentDashboard'
import MentorDashboard from './pages/dashboard/MentorDashboard'
import TeacherDashboard from './pages/dashboard/TeacherDashboard'
import AdminDashboard from './pages/dashboard/AdminDashboard'

// Student Components
import SubmitReport from './components/student/SubmitReport'
import RegisterInternship from './components/student/RegisterInternship'
import EditProfile from './components/student/EditProfile'
import ViewTeacherEvaluation from './components/student/ViewTeacherEvaluation'
import ViewMentorEvaluation from './components/student/ViewMentorEvaluation'

// Mentor Components
import MonitorStudents from './components/mentor/MonitorStudents'
import ReportReview from './components/mentor/ReportReview'
import DataStatistics from './components/mentor/DataStatistics'
import StudentAdvice from './components/mentor/StudentAdvice'
import MentorReport from './components/mentor/MentorReport'

// Teacher Components
import MonitorStudentProgress from './components/teacher/MonitorStudentProgress'
import FinalEvaluation from './components/teacher/FinalEvaluation'
import MonitorMentorEvaluation from './components/teacher/MonitorMentorEvaluation'

// Auth & Protection
import ProtectedRoute from './components/Auth/ProtectedRoute'
import { useAuth } from './context/AuthContext'

const App = () => {
  const { user } = useAuth()

  // Get dashboard component based on user role
  const getDashboardComponent = (role) => {
    switch (role) {
      case 'mentor':
        return MentorDashboard
      case 'teacher':
        return TeacherDashboard
      case 'admin':
        return AdminDashboard
      default:
        return StudentDashboard
    }
  }

  // Update the navigation config
  const navigationConfig = {
    mentor: {
      name: "Mentor Dashboard",
      navigation: [
        { name: 'Dashboard', icon: Home, path: '/dashboard' },
        { name: 'Monitor Students', icon: Users, path: '/dashboard/monitor' },
        { name: 'Review Reports', icon: FileText, path: '/dashboard/review' },
        { name: 'Give Advice', icon: MessageSquare, path: '/dashboard/advice' },
        { name: 'Student Progress', icon: BarChart3, path: '/dashboard/monitor' },
        { name: 'Statistics', icon: BarChart3, path: '/dashboard/statistics' }
      ],
      quickActions: [
        { name: 'Review Reports', icon: FileText, path: '/dashboard/review' },
        { name: 'Student Progress', icon: BarChart3, path: '/dashboard/monitor' }
      ]
    },
    // ... rest of the navigationConfig
  };

  return (
    <Router>
      <div className="min-h-screen bg-gray-50">
        <Toaster position="top-right" />
        <Routes>
          {/* Public Routes */}
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />

          {/* Protected Dashboard Routes */}
          <Route
            path="/dashboard/*"
            element={
              <ProtectedRoute>
                <DashboardLayout>
                  <Routes>
                    {/* Main Dashboard */}
                    <Route 
                      index 
                      element={React.createElement(getDashboardComponent(user?.role))} 
                    />

                    {/* Student Routes */}
                    {user?.role === 'student' && (
                      <>
                        <Route path="reports" element={<SubmitReport />} />
                        <Route path="internship" element={<RegisterInternship />} />
                        <Route path="profile" element={<EditProfile />} />
                        <Route path="evaluations/teacher" element={<ViewTeacherEvaluation />} />
                        <Route path="evaluations/mentor" element={<ViewMentorEvaluation />} />
                      </>
                    )}

                    {/* Mentor Routes */}
                    {user?.role === 'mentor' && (
                      <>
                        <Route path="monitor" element={<MonitorStudents />} />
                        <Route path="review" element={<ReportReview />} />
                        <Route path="statistics" element={<DataStatistics />} />
                        <Route path="advice" element={<StudentAdvice />} />
                        <Route path="reports" element={<MentorReport />} />
                      </>
                    )}

                    {/* Teacher Routes */}
                    {user?.role === 'teacher' && (
                      <>
                        <Route path="progress" element={<MonitorStudentProgress />} />
                        <Route path="evaluations" element={<FinalEvaluation />} />
                        <Route path="mentor-evaluations" element={<MonitorMentorEvaluation />} />
                      </>
                    )}
                  </Routes>
                </DashboardLayout>
              </ProtectedRoute>
            }
          />

          {/* Catch all route */}
          <Route path="*" element={<Navigate to="/dashboard" replace />} />
        </Routes>
      </div>
    </Router>
  )
}

export default App
